import { CompanyMap } from './googleMaps'
import axios from 'axios'
import { useState, useEffect } from 'react'
import { Collapsible } from './collapsible'
import { StyledButton } from '../style/collapsible.styled'

function FetchData() {
	const [data, setdata] = useState([0])

	// Select the DOM-element, so that you can replace it with content
	let PROJECT_ID = 'oans3nsr'
	let DATASET = 'production'
	let QUERY = encodeURIComponent('*[_type == "bedrift"]')

	// Compose the URL for your project's endpoint and add the query
	let URL = `https://${PROJECT_ID}.api.sanity.io/v2021-10-21/data/query/${DATASET}?query=${QUERY}`

	// fetch the content

	const getData = () => {
		axios.get(URL).then((res) => {
			setdata(res.data.result)
		})
	}
	useEffect(() => {
		getData()
	}, [])

	return (
		<div className='content-list'>
			{data.map((companys) => {
				return (
					<div>
						<Collapsible>
						<div>
							{companys.name}
							<button onClick={Collapsible}>Les mer</button>
						</div>
							<div className='company-text'>
								<h1>{companys.name}</h1>
								<p>
									Lorem ipsum dolor sit amet consectetur adipisicing elit.
									Necessitatibus natus ipsa recusandae exercitationem nulla
									praesentium, delectus vitae laboriosam dolorum veniam dolorem
									doloremque voluptatibus nemo reprehenderit nam facilis nobis
									sint aliquam?
								</p>
							</div>
							<div className='map'>
								<CompanyMap />
							</div>
						</Collapsible>
					</div>
				)
			})}
		</div>
	)
}

export default FetchData

